import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import { Link } from 'react-router-dom'
import './PastTrips.css'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    margin: 'auto',
    maxWidth: 300,
  },
  image: {
    width: 128,
    height: 128,
  },
  img: {
    margin: 'auto',
    display: 'block',
    maxWidth: '100%',
    maxHeight: '100%',
  },
}));



export default function ComplexGrid(tripName, members, date, tripExpense, image) {
  const classes = useStyles();
  tripName = 'PLANET YODA';
  members = 'BillyBrains, AlexTheMachine, HugoBoss';
  date = 'July 10, 2020'
  tripExpense = '$101.99'
  image= 'https://miro.medium.com/max/1200/1*mk1-6aYaf_Bes1E3Imhc0A.jpeg'
  return (
    <div className={classes.root} style={{textAlign: 'center'}}>
    <br/>
      <Paper className={classes.paper} style={{backgroundColor: 'aliceblue'}}>
        <Grid container spacing={2}>
          <Grid item>
              <Link to='/TripImage'><img style={{width: '100vw'}} className={classes.img} alt="complex" src={image} /></Link>
          </Grid>
          <Grid item xs={12} sm container>
            <Grid item xs container direction="column" spacing={2}>
              <Grid item xs>
                <Typography gutterBottom variant="subtitle1">
                  {tripName}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  {date}
                </Typography>
                <Typography variant="subtitle1">What you owe: {tripExpense}</Typography>
                <button>Receipts</button> | <button>Images</button>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Paper>
      <br/>
      <Paper className={classes.paper} style={{backgroundColor: 'aliceblue'}}>
        <Grid container spacing={2}>
          <Grid item>
              <Link to='/TripImage'><img style={{width: '100vw'}} className={classes.img} alt="complex" src={image} /></Link>
          </Grid>
          <Grid item xs={12} sm container>
            <Grid item xs container direction="column" spacing={2}>
              <Grid item xs>
                <Typography gutterBottom variant="subtitle1">
                  {tripName}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  {date}
                </Typography>
                <Typography variant="subtitle1">What you owe: {tripExpense}</Typography>
                <button>Receipts</button> | <button>Images</button>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Paper>
    </div>
  );
}
